import React from "react";

type Iprops = {
  title?: string;
  questionCount?: number;
};

const ResultComp = ({ title, questionCount }: Iprops) => {
  return (
    <>
      <div>
        <div>
          <h1>Quiz Completed </h1>
          <h2>You Scored ...</h2>
        </div>
        <div></div>
      </div>
    </>
  );
};

export default ResultComp;
